let demo = document.querySelector("#demo");
let style = document.querySelector("#style");
let string = `
/*ä½ å¥½ï¼Œæˆ‘æ˜¯æœ±éªæ°,
æˆ‘13å¹´æ¯•ä¸šäºŽä¸Šæµ·å•†å­¦é™¢,
ä¹‹å‰æœ‰ä¸‰å¹´çš„å¼€å‘ç»åŽ†,
ä¸¤å¹´çš„pythonå¼€å‘,ä¸€å¹´çš„å‰ç«¯å¼€å‘,
ä¹‹åŽæˆ‘è¿˜æ˜¯æƒ³è¦ä»Žäº‹å‰ç«¯æ–¹å‘çš„å·¥ä½œ,
çŽ°åœ¨è®©æˆ‘æˆ‘å°†å±•ç¤ºä¸€ä¸‹æˆ‘çš„cssæŠ€å·§,
é¦–å…ˆæˆ‘è¦å‡†å¤‡ä¸€ä¸ªdiv,
**/
#div1 {
    border: 1px solid red;
    width:200px;
    height:200px
}
/* æŽ¥ä¸‹æ¥æˆ‘æŠŠdivå˜æˆä¸€ä¸ªå…«å¦å›¾
æ³¨æ„çœ‹å¥½äº†
é¦–å…ˆï¼ŒæŠŠdivå˜æˆä¸€ä¸ªåœ† 
**/
#div1 {
  border-radius: 50%;
  box-shadow: 0 0 3px rgba(0, 0, 0, 0.5);
  border: none;
}
/* å…«å¦æ˜¯é˜´é˜³å½¢æˆçš„
* ä¸€é»‘ä¸€ç™½
**/
#div1 {
    background: linear-gradient(90deg, rgba(255,255,255,1) 0%, rgba(255,255,255,1) 50%, rgba(0,0,0,1) 50%, rgba(0,0,0,1) 100%);
}
/* åŠ ä¸Šä¸¤ä¸ªç¥žç§˜çš„å°çƒ */
#div1::before{
    width: 100px;
    height: 100px;
    top:0;
    left:50%;
    transform:translateX(-50%);
    background:#000;
    border-radius:50%;
    background: radial-gradient(circle, rgba(255,255,255,1) 0%, rgba(255,255,255,1) 25%, rgba(0,0,0,1) 25%, rgba(0,0,0,1) 100%);}
#div1::after{
    width: 100px;
    height: 100px;
    bottom:0;
    left:50%;
    transform:translateX(-50%);
    background:#fff;
    border-radius:50%;
    background: radial-gradient(circle, rgba(0,0,0,1) 0%, rgba(0,0,0,1) 25%, rgba(255,255,255,1) 25%, rgba(255,255,255,1) 100%);
}
`;

let string2 = "";
let n = 0;

// demo.innerHTML = string[0];

let step = () => {
  setTimeout(() => {
    if (string[n] === "\n") {
      string2 += "<br>";
    } else if (string[n] === " ") {
      string2 += "&nbsp";
    } else {
      string2 += string[n];
    }
    demo.innerHTML = string2;
    style.innerHTML = string.substring(0, n);
    window.scrollTo(0, 99999);
    // html.scrollTo(0, 99999);
    if (n < string.length - 1) {
      n = n + 1;
      step();
    }
  }, 50);
};

step();

